const URL = "http://localhost:8000/api/v1/reservas/"


export const novaReserva = async (newReserva) => {
    return await fetch(URL, {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json'
        },
        body: JSON.stringify({
            "nome": String(newReserva.name).trim(),
            "estacao": parseInt(newReserva.foundation),
            "periodo": String(newReserva.periodo).trim(),
            "data": new Date(newReserva.data)

        })
    });
};
